export const appModel = createContext(null);

const AppManager = ({ children }) => {
  const [userInput, setInput] = useState("Write Code here!");
  return (
    <appModel.Provider value={{ userInput, setInput }}>
      {children}
    </appModel.Provider>
  );
};
export default AppManager;
